package com.springcore.ref;

public class A {
	private int id;
	private B obj;
	
	public A() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public B getObj() {
		return obj;
	}

	public void setObj(B obj) {
		this.obj = obj;
	}

	@Override
	public String toString() {
		return "A [id=" + id + ", obj=" + obj + "]";
	}

	
	
	
	
	
}
